import { NavLink } from "react-router-dom";
import icon from "../../../assets/images/icons/back.png";
import cl from "./BackBtn.module.css";

export const BackBtn = ({ link }) => (
  <NavLink style={{position: "absolute", top: 15, left: 15, zIndex: 1000}} to={link}><img className={cl.btn} src={icon} alt="not found" /></NavLink>
);
